/**
 * This function prepares the data for the processing from a 
 * JSON-Array. It removes duplicates in groups and ignores 
 * undefined and null values.
 * @param {*} d input json array object
 * @param {*} xField field for the x axis
 * @param {*} yFields array of fields to be grouped in the y axis
 */
function initialize(d, xField, yFields, split) {
  if (!typeof Array) console.warn('Unrecognized input, array expected')
  d.sort((a, b) => a[xField] - b[xField])
  let ys = new Map()
  let xs = d.map((x, i) => {
    // create the x object
    let xObj = { 'index': i, 'xValue': x[xField], 'hidden': false, 'add': [], 'remove': [], 'data': x, 'group': [] }
    xObj.group = [...yFields.reduce((acc, y) => {
      if (x[y]) split ? split(x[y]).forEach(p => { if (p) acc.add(p) }) : acc.add(x[y])
      return acc
    }, new Set())]
      .map(y => {
        let yObj = ys.get(y)
        if (!yObj) {
          // create the y object
          yObj = { 'yID': y, 'layers': [], 'hidden': false, 'data': x }
        }
        yObj.layers.push(xObj)
        ys.set(y, yObj)
        return y
      })
    return xObj
  })
  return [xs, ys]
}

/**
 * Checks if p is undefined and in the given range
 * @param {*} p 
 * @param {*} range 
 */
function isInRange(p, range) {
  return range ?
    ((range[0] ? p >= range[0] : true) && (range[1] ? p <= range[1] : true)) : true
}

function filter(d, config) {
  // filter ys
  d = filterY(d, config)
  // filter xs
  d = filterX(d, config)
  return setLifeCycles(d)
}

function filterY(d, config) {
  Array.from(d[1]).forEach(yMap => {
    let y = yMap[1]
    let layers = y.layers.filter(l => !l.hidden)
    if (layers.length) {
      // todo count only not-hidden layers 
      let length = layers.length
      if (
        // check if y value has an xValue in the allowed range
        !isInRange(layers[layers.length - 1].xValue - layers[0].xValue, config.xValueLifeTime) ||
        // check if y value allowed amount of groups
        !isInRange(length, config.groupAmt) ||
        // check if y value has a index lifetime in the allowed range
        !isInRange(layers[layers.length - 1].index - layers[0].index, config.indexLifeTime)) {
        y.hidden = true
      }
    }
  })
  return d
}

function filterX(d, config) {
  let hiddenYs = new Set()
  let xs = d[0].map(layer => {
    hiddenYs.clear()
    // remove hidden ys from the group
    layer.group = layer.group.reduce((acc, y) => {
      !d[1].get(y).hidden ? acc.push(y) : hiddenYs.add(y)
      return acc
    }, [])
    layer.hiddenYs = [...hiddenYs]
    // check if layer is hidden
    if (
      !isInRange(layer.group.length, config.groupSize) ||
      !isInRange(layer.index, config.index) ||
      !isInRange(layer.xValue, config.xValue) ||
      !(layer.group.length > 0)
    ) {
      layer.hidden = true
    }
    return layer
  })
  return [xs, d[1]]
}

function setLifeCycles(d) {
  d[1].forEach(y => {
    let visibleLayers = y.layers.filter(layer => layer.hidden != true)
    if (visibleLayers.length) {
      d[0][visibleLayers[0].index].add.push(y.yID)
      d[0][visibleLayers[visibleLayers.length - 1].index].remove.push(y.yID)
    } else {
      y.hidden = true
    }
  })
  return d
}

function traverse(d, yEntryPoints) {
  let visitor = []
  yEntryPoints = yEntryPoints ? yEntryPoints : new Map()
  let prevIndex = 0
  return [d[0].reduce((acc, x, i) => {
    // check if this x layer is hidden
    if (!x.hidden) {
      if (i != 0) d[0][prevIndex].remove.forEach(a => visitor = remove(visitor, a))
      x.add.forEach(a => {
        let entryPoint = yEntryPoints.get(a)
        if (!entryPoint) {
          entryPoint = Math.ceil(Math.random() * visitor.length)
          yEntryPoints.set(a, entryPoint)
        }
        add(visitor, a, entryPoint)
      })
      x.switch = group(visitor, x.group)
      x.state = [...visitor]
      prevIndex = i
      acc.push(x)
    }
    return acc
  }, []), yEntryPoints]
}

function group(visitor, d) {
  // calculate the center
  let center = getCenter(visitor, d)
  // let center = 0
  // calculate the distance from the mass center
  let dists = getDistances(visitor, d, center)
  // array containing the switch operations
  let switches = []
  // array describing the outer boundary of the already-adiacent group elements
  let edges = [Math.ceil(center), Math.floor(center)]
  // looping strategies for backward and forward searching
  let proc = new Map()
  // first element is the descending edge, the second one the ascending
  proc.set(1, { 'init': 1, 'comp': (i) => i < visitor.length })
  proc.set(-1, { 'init': 0, 'comp': (i) => i >= 0 })
  // Check for every y that has to be grouped if it is adjacent, else switch
  dists.forEach(p => {
    let direction = -Math.sign(p.distance)
    if (direction != 0) {
      let strategy = proc.get(direction)
      let index = visitor.indexOf(p.p)
      for (let i = edges[strategy.init]; strategy.comp(i); i += direction) {
        if ((index >= edges[0] && index <= edges[1]) ||
          (edges[1] === 0 && direction === 1) ||
          (edges[0] === visitor.length - 1 && direction === -1)) {
          // if the index of p in the visitor is inside the edges, it is adjacent
          // if the edges are at the end of the visitor and the direction points 
          // to it, then p is adjacent
          break
        } else if (!dists.some(a => a.p === visitor[i])) {
          // if the visited y is a non-grouped element, then switch it 
          // with the current element p
          switches.push({ 'target': i, 'prev': index })
          switchP(visitor, i, index)
          break
        } else {
          // extend adjacent edges
          edges[strategy.init] += direction
        }
      }
    }
  })
  return switches
}

function getCenter(visitor, d) {
  return visitor.reduce((c, p, i) => {
    return d.includes(p) ? c + i : c
  }, 0) / d.length
}

function getDistances(visitor, d, center) {
  return d
    .filter(p => !p.hidden)
    .map(p => {
      let i = visitor.indexOf(p)
      let distance = center - i
      return { p, distance }
    })
    .sort((a, b) => Math.abs(a.distance) - Math.abs(b.distance))
}

function add(visitor, a, entryPoint) {
  // a contains the yObj and the index of the entry point
  return visitor.splice(entryPoint, 0, a)
}

function switchP(visitor, target, prev) {
  // move the yObj to the group and shift all the others
  let temp = visitor.splice(prev, 1)
  visitor.splice(target, 0, ...temp)
}

function remove(visitor, a) {
  // a contains the yObj
  return visitor.filter(p => p != a)
}

function calculate(d, lossFunc) {
  let best = undefined
  let population = undefined
  let newGenes = undefined
  let generationAmt = 160
  let populationSize = 40
  let selectionRate = 0.25
  for (let i = 0; i < generationAmt; i++) {
    population = getGeneration(d, lossFunc, populationSize, newGenes)
    if (!best || population[0].loss < best.loss) {
      best = population[0]
      console.log(best)
    }
    let parents = select(population, selectionRate)
    newGenes = mate(parents, selectionRate)
    newGenes = mutate(newGenes, d)
  }
  return [best.x, d[1]]
}

function getGeneration(d, lossFunc, populationSize, yEntryPoints) {
  let population = []
  // Compute new generation
  for (i = 0; i < populationSize; i++) {
    entryPoints = yEntryPoints ? yEntryPoints[i] : undefined
    let child = traverse(d, entryPoints)
    let loss = lossFunc(child)
    population.push({ 'loss': loss, 'genome': child[1], 'x': child[0] })
  }
  return population.sort((a, b) => a.loss - b.loss)
}

function select(population, selectionRate) {
  let parents = []
  let length = population.length / 2
  for (i = 0; i < length; i++) {
    let index = Math.floor(Math.pow(Math.random(), 8) * population.length)
    let parent = population[index]
    population.splice(index, 1)
    parents.push(parent)
  }
  return parents
}

function mate(parents, selectionRate) {
  let children = []
  for (i = 0; i < parents.length / selectionRate; i++) {
    let parent1 = undefined
    let parent2 = undefined
    let index = undefined
    while (parent1 === parent2) {
      index = Math.floor(Math.pow(Math.random(), 5) * parents.length)
      parent1 = parents[index]
      index = Math.floor(Math.pow(Math.random(), 5) * parents.length)
      parent2 = parents[index]
    }
    let genome1 = Array.from(parent1.genome)
    let genome2 = Array.from(parent2.genome)
    let child = genome1.reduce((map, gene, i) => {
      if (Math.random() < 0.5) {
        gene = genome2[i]
      }
      return map.set(gene[0], gene[1])
    }, new Map())
    children.push(child)
  }
  return children
}

function mutate(children, d) {
  // probability that a gene mutates (value between 0 and 1)
  let mutationLikeliness = 0.05
  children.forEach((_, i) => {
    d[0].forEach(x => {
      if (!x.hidden) {
        x.add.forEach(y => {
          if (Math.random() < mutationLikeliness) {
            let newY = Math.floor(Math.random() * x.state.length)
            children[i].set(y, newY)
          }
        })
      }
    })
  }
  )
  return children
}

function getLoss(d) {
  let amtLoss = 8
  let lengthLoss = 4
  let centeredAddLoss = 1
  let centeredRemoveLoss = 1
  let acc = 0
  for (let i = 0; i < d[0].length; i++) {
    let center = d[0][i].state.length / 2
    // Penalty for adding ys in the middle
    acc += d[0][i].add.reduce((a, s) => {
      return a + Math.abs(d[1].get(s) - center)
    }, 0) * centeredAddLoss
    // Penalty for removing ys in the middle
    acc += d[0][i].remove.reduce((a, s) => {
      return a + Math.abs(d[1].get(s) - center)
    }, 0) * centeredRemoveLoss
    // Penalty for the amount of switches
    acc += d[0][i].switch.reduce((a, s) => {
      if (!d[0][i].add.includes(d[0][i].state[s.prev])) a++
      return a
    }, 0) * amtLoss
    // Penalty for the size of the switches
    acc += d[0][i].switch.reduce((a, s) => {
      if (!d[0][i].add.includes(d[0][i].state[s.prev])) a + Math.abs(s.target - s.prev)
      return a
    }, 0) * lengthLoss
  }
  return acc
}

function draw(d, centered) {
  let result = []
  let maxLen = d[0].reduce((max, layer) => Math.max(max, layer.state.length), 0)
  d[0].forEach((layer, x) => {
    layer.state.forEach((p, y) => {
      y = centered ? (layer.state.length - 1) / 2 - y : y
      let isGrouped = d[0][x].group.some(a => a === p)
      let strokeWidth = layer.data.Int
      let xVal = layer.xValue
      let xDescription = layer.xValue + ', ' + layer.data.Location
      let yVal = d[1].get(p)
      result.push({ 'x': x, 'y': y, 'z': p, 'isGrouped': isGrouped, 'strokeWidth': strokeWidth, 'xVal': xVal, 'xDescription': xDescription })
    })
  })
  // todo this is ugly and inefficient
  let points = new Map()
  result.forEach(r => {
      let arr = points.get(r.z) ? points.get(r.z) : []
      arr.push({'x': r.x, 'y': r.y, 'bool': r.isGrouped, 'strokeWidth': r.strokeWidth})
      points.set(r.z, arr)
  })
  result.map(r => {
    r.pointsX = points.get(r.z).map(g => g.x)
    r.pointsY = points.get(r.z).map(g => g.y)
    r.pointsBool = points.get(r.z).map(g => g.bool)
    r.pointsSize = points.get(r.z).map(g => g.strokeWidth)
    return r
  })
  return [result, maxLen]
}

